.el-scrollbar__wrap {
  overflow-x: hidden;
 }
  .el-upload-list--picture-card{
    display:inline-block !important;
    line-height:0;
  }
  .upload-preview{
    float:left;width:148px;height:148px;border-radius:10px;border: 1px solid #c0ccda;border-radius: 6px;margin: 0 8px 8px 0;overflow:hidden;position:relative;
  }
  .upload-preview img{width:100%;height:100%;display:block;}
  .upload-preview .upload-action{
    position:absolute;
    top:0;
    left:0;
    width:100%;
    height:100%;
    background:rgba(0,0,0,.5);
    text-align:center;
    line-height:148px;
    font-size:20px;
    color:#fff;
    display:none;
  }
  .upload-preview.active .upload-action{
    display:block;
  }
  .upload-preview .upload-action a{
    color:#fff;
  }
